Job Description:
Location: Clarkson Valley, MO
Description: Our client is currently seeking a DATA SCIENTIST

Responsibilities:

• Build R-Shiny apps for lab scientists collaboratively working with them throughout the process to make sure the final is of quality and use while increasing the digital fluency of the lab scientists.
• Be heavily involved in global and regional projects that involve developing machine learning and/or artificial intelligence solutions for new chemistry discovery and development. This will involve attending and actively contributing to meetings with lab scientists and leaders, developing machine learning models and automation tools.
• Design lab assays and experiments. Analyze, visualize, and interpret data both from designed experiments as well as internal and external existing data stores.
• Developing Spotfire dashboards with lab scientists to enable them to visualize their data (ability to build API's for Spotfire would be ideal).
• (would be nice) Assist with data engineering, cloud architecting, and other IT-type responsibilities when IT resources are reduced.

Required Qualifications:
• Minimum of a bachelor’s degree with more than five years of experience or master’s degree with more than two years’ experience or Ph.D.;
• Educational preparation in at least one of the following areas: Machine Learning, Statistics, Biostatistics, Data Science, or other related quantitative discipline;
• Demonstrates intermediate proficiency in computational skills and level of experience building data models using R, Python or other statistical and/or mathematical programming packages;
• Demonstrates basic understanding of software development best practices (Version Control, Code Documentation & Review, Cloud Based Sequence Analysis, Database Management);
• Strong proficiency in predictive modeling—to include comprehension of theory, modeling/identification strategies and limitations and pitfalls;
• Intermediate proficiency in machine learning algorithms and concepts;
• Experience in successful delivery of valuable analysis through application of domain knowledge; evidence of ability to strong business acumen;
• Strong communication competencies to include presentations and delivery of complex quantitative analyses in a clear, concise and actionable manner to extended team and small groups of key stakeholders.
• Ability to collaborate and work effectively with other individuals of diverse backgrounds in diverse fields of science and technologies.

